import React from "react";
import { Link } from "react-router-dom";

export const FlowerCartAlertMessage = () => {
  return (
    <section id="alarm_message">
      <h2>Warning</h2>
      <div>Your shopping ccart is empty. Please, order something</div>
      <button>
        <Link to="/">To main page</Link>
      </button>
    </section>
  );
};
